"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[6783],{37215:(e,t,s)=>{s.r(t),s.d(t,{default:()=>n,johnChapter3ES:()=>o});const o={chapter:3,title:"Juan 3",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Y hab\xeda un hombre de los Fariseos que se llamaba Nicodemo, pr\xedncipe de los Jud\xedos.",strong:[{text:"hombre",strong:"G444",start:11,end:17},{text:"Nicodemo",strong:"G3530",start:49,end:57}]},{number:2,text:"Este vino \xe1 Jes\xfas de noche, y d\xedjole: Rabb\xed, sabemos que has venido de Dios por maestro; porque nadie puede hacer estas se\xf1ales que t\xfa haces, si no fuere Dios con \xe9l.",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"noche",strong:"G3571",start:21,end:26},{text:"Dios",strong:"G2316",start:71,end:75},{text:"maestro",strong:"G1320",start:80,end:87},{text:"nadie",strong:"G3762",start:96,end:101},{text:"hacer",strong:"G1080",start:108,end:113},{text:"Dios",strong:"G2316",start:154,end:158}]},{number:3,text:"Respondi\xf3 Jes\xfas, y d\xedjole: De cierto, de cierto te digo, que el que no naciere otra vez, no puede ver el reino de Dios.",strong:[{text:"Dios",strong:"G2316",start:114,end:118}]},{number:4,text:"D\xedcele Nicodemo: \xbfC\xf3mo puede el hombre nacer siendo viejo? \xbfpuede entrar otra vez en el vientre de su madre, y nacer?",strong:[{text:"Nicodemo",strong:"G3530",start:7,end:15},{text:"hombre",strong:"G444",start:32,end:38},{text:"nacer",strong:"G1080",start:39,end:44},{text:"nacer",strong:"G1080",start:111,end:116}]},{number:5,text:"Respondi\xf3 Jes\xfas: De cierto, de cierto te digo, que el que no naciere de agua y del Esp\xedritu, no puede entrar en el reino de Dios.",strong:[{text:"agua",strong:"H4325",start:72,end:76},{text:"Dios",strong:"G2316",start:124,end:128}]},{number:6,text:"Lo que es nacido de la carne, carne es; y lo que es nacido del Esp\xedritu, esp\xedritu es.",strong:[{text:"carne",strong:"G4561",start:23,end:28},{text:"carne",strong:"G4561",start:30,end:35}]},{number:7,text:"No te maravilles de que te dije: Os es necesario nacer otra vez.",strong:[{text:"nacer",strong:"G1080",start:49,end:54}]},{number:8,text:"El viento de donde quiere sopla, y oyes su sonido; mas ni sabes de d\xf3nde viene, ni \xe1 d\xf3nde vaya: as\xed es todo aquel que es nacido del Esp\xedritu.",strong:[{text:"viento",strong:"G4151",start:3,end:9},{text:"todo",strong:"G3956",start:104,end:108}]},{number:9,text:"Respondi\xf3 Nicodemo, y d\xedjole: \xbfC\xf3mo puede esto hacerse?",strong:[{text:"Nicodemo",strong:"G3530",start:10,end:18},{text:"esto",strong:"G3778",start:42,end:46},{text:"hacerse",strong:"G1096",start:47,end:54}]},{number:10,text:"Respondi\xf3 Jes\xfas, y d\xedjole: \xbfT\xfa eres el maestro de Israel, y no sabes esto?",strong:[{text:"maestro",strong:"G1320",start:39,end:46},{text:"esto",strong:"G3778",start:69,end:73}]},{number:11,text:"De cierto, de cierto te digo, que lo que sabemos hablamos, y lo que hemos visto, testificamos; y no recib\xeds nuestro testimonio.",strong:[{text:"testimonio",strong:"G3141",start:116,end:126}]},{number:12,text:"Si os he dicho cosas terrenas, y no cre\xe9is, \xbfc\xf3mo creer\xe9is si os dijere las celestiales?",strong:[{text:"creer",strong:"G4100",start:50,end:55}]},{number:13,text:"Y nadie subi\xf3 al cielo, sino el que descendi\xf3 del cielo, el Hijo del hombre, que est\xe1 en el cielo.",strong:[{text:"nadie",strong:"G3762",start:2,end:7},{text:"cielo",strong:"H8064",start:17,end:22},{text:"cielo",strong:"H8064",start:50,end:55},{text:"Hijo",strong:"G5207",start:60,end:64},{text:"hombre",strong:"G444",start:69,end:75},{text:"cielo",strong:"H8064",start:92,end:97}]},{number:14,text:"Y como Mois\xe9s levant\xf3 la serpiente en el desierto, as\xed es necesario que el Hijo del hombre sea levantado;",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"serpiente",strong:"G3789",start:25,end:34},{text:"desierto",strong:"G2048",start:41,end:49},{text:"Hijo",strong:"G5207",start:75,end:79},{text:"hombre",strong:"G444",start:84,end:90}]},{number:15,text:"Para que todo aquel que en \xe9l creyere, no se pierda, sino que tenga vida eterna.",strong:[{text:"todo",strong:"G3956",start:9,end:13},{text:"vida",strong:"G2222",start:68,end:72}]},{number:16,text:"Porque de tal manera am\xf3 Dios al mundo, que ha dado \xe1 su Hijo unig\xe9nito, para que todo aquel que en \xe9l cree, no se pierda, mas tenga vida eterna.",strong:[{text:"Dios",strong:"G2316",start:25,end:29},{text:"mundo",strong:"G2889",start:33,end:38},{text:"Hijo",strong:"G5207",start:57,end:61},{text:"todo",strong:"G3956",start:82,end:86},{text:"vida",strong:"G2222",start:133,end:137}]},{number:17,text:"Porque no envi\xf3 Dios \xe1 su Hijo al mundo, para que condene al mundo, mas para que el mundo sea salvo por \xe9l.",strong:[{text:"Dios",strong:"G2316",start:16,end:20},{text:"Hijo",strong:"G5207",start:26,end:30},{text:"mundo",strong:"G2889",start:34,end:39},{text:"mundo",strong:"G2889",start:61,end:66},{text:"mundo",strong:"G2889",start:84,end:89}]},{number:18,text:"El que en \xe9l cree, no es condenado; mas el que no cree, ya es condenado, porque no crey\xf3 en el nombre del unig\xe9nito Hijo de Dios.",strong:[{text:"nombre",strong:"G3686",start:95,end:101},{text:"Hijo",strong:"G5207",start:116,end:120},{text:"Dios",strong:"G2316",start:124,end:128}]},{number:19,text:"Y esta es la condenaci\xf3n: porque la luz vino al mundo, y los hombres amaron m\xe1s las tinieblas que la luz; porque sus obras eran malas.",strong:[{text:"esta",strong:"G3778",start:2,end:6},{text:"mundo",strong:"G2889",start:48,end:53}]},{number:20,text:"Porque todo aquel que hace lo malo, aborrece la luz y no viene \xe1 la luz, porque sus obras no sean redarg\xfcidas.",strong:[{text:"todo",strong:"G3956",start:7,end:11}]},{number:21,text:"Mas el que obra verdad, viene \xe1 la luz, para que sus obras sean manifestadas que son hechas en Dios.",strong:[{text:"obra",strong:"G2041",start:11,end:15},{text:"verdad",strong:"G225",start:16,end:22},{text:"Dios",strong:"G2316",start:95,end:99}]},{number:22,text:"Pasado esto, vino Jes\xfas con sus disc\xedpulos \xe1 la tierra de Judea; y estaba all\xed con ellos, y bautizaba.",strong:[{text:"esto",strong:"G3778",start:7,end:11},{text:"tierra",strong:"H776",start:48,end:54}]},{number:23,text:"Y bautizaba tambi\xe9n Juan en En\xf3n junto \xe1 Salim, porque hab\xeda all\xed muchas aguas; y ven\xedan, y eran bautizados.",strong:[{text:"Juan",strong:"G2491",start:20,end:24},{text:"aguas",strong:"H4325",start:73,end:78}]},{number:24,text:"Porque Juan no hab\xeda sido a\xfan puesto en la c\xe1rcel.",strong:[{text:"Juan",strong:"G2491",start:7,end:11}]},{number:25,text:"Y hubo cuesti\xf3n entre los disc\xedpulos de Juan y los Jud\xedos acerca de la purificaci\xf3n.",strong:[{text:"Juan",strong:"G2491",start:40,end:44}]},{number:26,text:"Y vinieron \xe1 Juan, y dij\xe9ronle: Rabb\xed, el que estaba contigo de la otra parte del Jord\xe1n, del cual t\xfa diste testimonio, he aqu\xed bautiza, y todos vienen \xe1 \xe9l.",strong:[{text:"Juan",strong:"G2491",start:13,end:17},{text:"testimonio",strong:"G3141",start:108,end:118}]},{number:27,text:"Respondi\xf3 Juan, y dijo: No puede el hombre recibir algo, si no le fuere dado del cielo.",strong:[{text:"Juan",strong:"G2491",start:10,end:14},{text:"hombre",strong:"G444",start:36,end:42},{text:"recibir",strong:"G3880",start:43,end:50},{text:"cielo",strong:"H8064",start:81,end:86}]},{number:28,text:"Vosotros mismos me sois testigos que dije: Yo no soy el Cristo, sino que soy enviado delante de \xe9l.",strong:[{text:"Cristo",strong:"G5547",start:56,end:62}]},{number:29,text:"El que tiene la esposa, es el esposo; mas el amigo del esposo, que est\xe1 en pie y le oye, se goza grandemente de la voz del esposo; as\xed pues, este mi gozo es cumplido.",strong:[{text:"este",strong:"G3778",start:141,end:145}]},{number:30,text:"A \xe9l conviene crecer, mas \xe1 m\xed menguar.",strong:[]},{number:31,text:"El que de arriba viene, sobre todos es: el que es de la tierra, terreno es, y cosas terrenas habla: el que viene del cielo, sobre todos es.",strong:[{text:"tierra",strong:"H776",start:56,end:62},{text:"cielo",strong:"H8064",start:117,end:122}]},{number:32,text:"Y lo que vi\xf3 y oy\xf3, esto testifica: y nadie recibe su testimonio.",strong:[{text:"esto",strong:"G3778",start:20,end:24},{text:"nadie",strong:"G3762",start:38,end:43},{text:"testimonio",strong:"G3141",start:54,end:64}]},{number:33,text:"El que recibe su testimonio, \xe9ste sign\xf3 que Dios es verdadero.",strong:[{text:"testimonio",strong:"G3141",start:17,end:27},{text:"Dios",strong:"G2316",start:44,end:48}]},{number:34,text:"Porque el que Dios envi\xf3, las palabras de Dios habla: porque no da Dios el Esp\xedritu por medida.",strong:[{text:"Dios",strong:"G2316",start:14,end:18},{text:"Dios",strong:"G2316",start:42,end:46},{text:"Dios",strong:"G2316",start:67,end:71}]},{number:35,text:"El Padre ama al Hijo, y todas las cosas di\xf3 en su mano.",strong:[{text:"Padre",strong:"G3962",start:3,end:8},{text:"Hijo",strong:"G5207",start:16,end:20},{text:"mano",strong:"G5495",start:50,end:54}]},{number:36,text:"El que cree en el Hijo, tiene vida eterna; mas el que es incr\xe9dulo al Hijo, no ver\xe1 la vida, sino que la ira de Dios est\xe1 sobre \xe9l.",strong:[{text:"Hijo",strong:"G5207",start:18,end:22},{text:"vida",strong:"G2222",start:30,end:34},{text:"Hijo",strong:"G5207",start:70,end:74},{text:"vida",strong:"G2222",start:87,end:91},{text:"Dios",strong:"G2316",start:112,end:116}]}]},n=o}}]);
